import React from 'react';
import {
  BackgroundWrapper,
  MyPostWrapper,
  ProfileImg,
  ProfileInfoWrapper,
  ProfileWrapper,
  Text,
} from './MypageStyle';
import Profile from '../../assets/img/profile.jpg';

const Mypage: React.FC = () => {
  return (
    <BackgroundWrapper>
      <ProfileWrapper>
        <ProfileImg src={Profile} />
        <ProfileInfoWrapper>
          <Text>char_smine</Text>
        </ProfileInfoWrapper>
      </ProfileWrapper>
      <MyPostWrapper />
    </BackgroundWrapper>
  );
};

export default Mypage;
